      () => () => {
        ;(overmind as any).proxyStateTree.disposeTree(tree)
        overmind.eventHub.emitAsync(EventType.COMPONENT_REMOVE, {
          componentId: component.__componentId,
          componentInstanceId: debugging.componentInstanceId,
          name,
        })
      },
      []
    )

